    // Get the version string
    String version = doc['version.keyword'].value;

    // Remove any suffix after the patch number (e.g., -SNAPSHOT)
    int dashIndex = version.indexOf('-');
    if (dashIndex != -1) {
        version = version.substring(0, dashIndex);
    }

    // Find positions of dots
    int firstDot = version.indexOf('.');
    int secondDot = version.indexOf('.', firstDot + 1);

    // Extract major, minor, and patch parts of the version
    int major = Integer.parseInt(version.substring(0, firstDot));
    int minor = Integer.parseInt(version.substring(firstDot + 1, secondDot));
    int patch = Integer.parseInt(version.substring(secondDot + 1));

    // Combine into a sortable numeric value
    emit(major * 10000 + minor * 100 + patch);
}

